Mongoose aggregate, can't dynamically add someField: { $not; null }<p>I am generating a query based on user's input as to conditions.  User can set custom filtering by making selections.  </p>

<p>All is okay, so far.  For example, this works:</p>

<pre><code>exports.getJoinedTransactions = function(firmId, page, pageSize, billerId, matterId, words, billingStatus, cb) {

    let firmIdToObjId = new mongoose.Types.ObjectId(global.user.firmId);
    let query = { firmId: firmIdToObjId };

    if ( typeof billerId === "object" ) {
        billerId = new mongoose.Types.ObjectId(billerId);
        query.contactId = billerId;
    }

    if ( typeof matterId === "object" ) {
        matterId = new mongoose.Types.ObjectId(matterId);
        query.matterId = matterId;
    }

    ....

    myAggregate = [
        { $sort: { date: -1 } },
        {
            $match: query
        },

    ....

    Transactions.aggregate(myAggregate).exec( function(err, transactions) {

        if (err) {
            console.log(err);
        }

        someVar = transactions.length;

    ....
</code></pre>

<p>This builds the query nicely and runs well.  Now, however, I have a slightly different requirement to add to the list.  I want to also include a possible query for null or not null.  Something like this:</p>

<pre><code>if (typeof billingStatus === "string" &amp;&amp; billingStatus != "") {

    if (billingStatus === "billed") {
        query.billId = { $not: null } ;          &lt;-- This does not work.
    } else if (billingStatus === "unbilled") {
        query.billId = null;                     &lt;-- This works!
    }
}
</code></pre>

<p>When I run this code setting the status to "billed," no error is thrown.  However, no "transactions" are returned, either.  An error is thrown:  "Cannot read property 'length' of undefined." </p>

<p>How can I fix the broken part?</p>

<p>Edit:  By the way, there are 5 records total, and 1 is billed.  When it works, I should receive the 1 record.</p>

